import React from "react";
import "../App.css";
import logo from './UniversityOfWaterloo_logo_horiz_bk.png';

function Landing() {
  return (
    <div className="header-container">
      <nav className="nav-bar">
        <a href="#about" className="nav-link">About</a>
        <a href="#projects" className="nav-link">Projects</a>
        <a href="#resume" className="nav-link">Resume</a>
        <a href="#github" className="nav-link">Github</a>
      </nav>
      <div className="center-content">
        <img 
          src={logo}
          alt='University of Waterloo'
          className="center-logo"
        />
        <h1>Khyle Dhanani</h1>
        <h3>Bachelor of Mathematics</h3>
        <h3>Specializing in Math/Financial Analysis and Risk Management</h3>
        <h3>Minor in Computing</h3>
      </div>
    </div>
  );
}

export default HeaderBar;
